import React from "react";
import { Table } from "react-bootstrap";

const DailyIntakeTable = ({ data }) => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Column 1</th>
          <th>Column 2</th>
          {/* Add more table headers as needed */}
        </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{index + 1}</td>
            <td>{item.column1}</td>
            <td>{item.column2}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

export default DailyIntakeTable;
